import React, { useState, useRef } from "react";
import yogamat from '../images/yogamat.jpg'
import { QnA } from './QnA'
import { EventCalendar } from './Calendar/EventCalendar';
import styled from 'styled-components';

const Section = styled.section`
display: flex;
`

const ClassCard = styled.div`
overflow-x: visible; 


 align-items: center;
background-color: rgba(256,256,256,0.8);
border-radius: 16px;
width: 40%;
padding: 40px; 
  margin: 40px; 
box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19);
@media(min-width: 668px){


}
@media(min-width: 1024px){


}
`

export const ThemeClasses = () => {
  return (
    <Section>
      <ClassCard>
        <p>TEMAKLASSER
        Under hösten kommer Studio Yogaheart erbjuda
        temaklasser i Hathayoga en gång i månaden. Varje månad
        och klass har ett eget unikt tema.
        Samtliga klasser inleds med andningsteknik (pranayama)
        och centrering för att övergå i en kortare informativ del om
        aktuellt tema, olika positioner och deras effekter. Vi
        kommer gå igenom teknik och linjering för att sedan
        varsamt praktisera positionerna tillsammans. Vi avslutar
    med avslappning och i vissa fall med meditation. </p>
      </ClassCard>
      <ClassCard>
        <h2>Temaklasser hösten 2020</h2><h3>12 september (framåtfällningar)</h3>
        <h3>17 oktober (bakåtböjningar)</h3>
        <h3>7 november (höftöppnare)
    </h3>
        <h3>12 december (pranayama & meditation)</h3>
      </ClassCard>

    </Section>
  )
}
